import React, {useState, useEffect, useRef} from 'react'
import NothingToDisplay from './NothingToDisplay'
import { Checkbox, withStyles, makeStyles, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@material-ui/core'

const useStyles = makeStyles(theme => (
    {
            headingColor : {
                backgroundColor :'#94b3f6',
            },
            tableRowHover: {
                "&:hover": {
                        backgroundColor: "#dad9df !important",
                    }
            }
    }));


const StyledTableRow = withStyles((theme) => ({
    root: {
      '&:nth-of-type(odd)': {
        backgroundColor: '#f4f3f9',
      },
    },
  }))(TableRow);


export default function IsIncorrect() {

    const classes = useStyles()
    const [isChecked, setIsChecked] = useState()
    const [isItemSelected , setIsItemSelected] = useState(false)
    const [disabledData, setDisabledData] = useState([])
    const liRefs = []

    const [incorrectData, setIncorrectData] = useState([])
    const isMounted = useRef(false)


    async function getIncorrectRecipes(){
        try{
            const data = await fetch('https://beta.eagleowl.in/api/v1/mock/organization/18/outlet/18/recipe/recipes/?page=1&is_incorrect=true')
            const json = await data.json()
            setIncorrectData(json.results)
        }
        catch(err){
            console.log(err)
        }
        
    }
    
    useEffect(()=>{
        getIncorrectRecipes()
    },[])

    useEffect(()=>{
        if(isMounted.current){
            console.log(incorrectData)
        }
        else{
            isMounted.current = true
        }
    },[incorrectData])


    
    const handleChange = (e) => {
        setIsItemSelected(e.target.checked);
      };

    const handleRowChange = (event) => {

        setIsItemSelected(event.target.checked);
        const check = event.target.checked

            // for(var i=0; i<liRefs.length;i++){
            //     liRefs[i].firstChild.firstChild.checked = true
            // }
    } 

    return(
        <>
            {
                (isMounted.current ? ( incorrectData.length === 0 ? <NothingToDisplay /> : incorrectData.map( recipe => {
                    // return(
                    //         <div  key={recipe.id}>
                    //             <div>
                    //                 <p>{recipe.name}</p>
                    //                 <p>{recipe.last_updated.date}</p>
                    //                 <p>{recipe.cogs}</p>
                    //                 <p>{recipe.cost_price}</p>
                    //                 <p>{recipe.sale_price}</p>
                    //                 <p>{recipe.gross_margin}</p>
                    //             </div>
                    //             <hr></hr>
                    //         </div>
                        
                    //     ) 
                    <TableContainer component = {Paper}>
                        <Table aria-label = "disabled-recipes">
                            <TableHead>
                                <TableRow className = {classes.headingColor}>
                                    <TableCell className="selectCheckbox" padding="checkbox">
                                    <Checkbox
                                        onChange={handleRowChange}
                                        color="primary"
                                        inputProps={{ 'aria-label': 'secondary checkbox' }}
                                    />
                                    </TableCell>
                                    <TableCell>NAME</TableCell>
                                    <TableCell>LAST UPDATED</TableCell>
                                    <TableCell>COGS</TableCell>
                                    <TableCell>COST PRICE</TableCell>
                                    <TableCell>SALE PRICE</TableCell>
                                    <TableCell>GROSS MARGIN</TableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                                {
                                    disabledData.map( (recipe,idx) => (
                                        <StyledTableRow key={recipe.id} hover className={classes.tableRowHover} onClick={handleChange}>
                                            <TableCell className="selectCheckbox" padding="checkbox">
                                                <Checkbox
                                                    ref = {ref => (liRefs[idx] = ref)}
                                                    onClick = {handleChange}
                                                    color="primary"
                                                    inputProps={{ 'aria-label': 'secondary checkbox' }}
                                                    className = "heyCheckbox"
                                                />
                                            </TableCell>
                                            <TableCell>{recipe.name}</TableCell>
                                            <TableCell>{recipe.last_updated.date}</TableCell>
                                            <TableCell>{recipe.cogs}</TableCell>
                                            <TableCell>{recipe.cost_price}</TableCell>
                                            <TableCell>{recipe.sale_price}</TableCell>
                                            <TableCell>{recipe.gross_margin}</TableCell>
                                        </StyledTableRow>
                                    ))
                                }
                            </TableBody>
                        </Table>
                    </TableContainer>
                    })) : null)
            }
        </>

    )
}
